import React from 'react';

function ViewTodo({ todo }) {
    // Log the todos array to inspect the data structure
    console.log(todo);

    // Conditional rendering to handle empty todo list
    if (!todo || todo.length === 0) {
        return <p>No tasks available</p>;
    }

    return (
        <div>
            {
                todo.map((item, index) => (
                    <div key={index}>  {/* Replace `index` with a unique ID if available, like `item.id` */}
                        <h2>{item.name}</h2>
                        {item.email && <p>Email: {item.email}</p>}
                        {item.task && <p>Task: {item.task}</p>}
                    </div>
                ))
            }
        </div>
    );
}

export default ViewTodo;
